INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 106001, "2015/12/17 15:00:00", "たまには\n協力するのもいいんじゃない？\nあたしも手を貸してあげる", 1, "キャル", 7, -363.0, 7001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105901, "2015/12/17 15:00:00", "多くの方と協力して\n戦えるようです\n主さまなら、さぞ\nご活躍なさることでしょう", 1, "コッコロ", 7, -363.0, 7002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105801, "2015/12/17 15:00:00", "たくさんの人と一緒に\n協力バトルです！\nがんばりましょう☆", 1, "ペコリーヌ", 7, -363.0, 7003);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105801, "2015/12/17 15:00:00", "ジュエルを食べ物…\nいえ、貴重品と交換できます！", 1, "ペコリーヌ", 10, -363.0, 10001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 106001, "2015/12/17 15:00:00", "ジュエルはよく考えて\n使うことね\n無駄遣い厳禁！", 1, "キャル", 10, -363.0, 10002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105901, "2015/12/17 15:00:00", "主さまのジュエルで\n貴重な品々を購入できます\nですが、無駄遣いは\n『めっ』でございますよ", 1, "コッコロ", 10, -363.0, 10003);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 2104010, 1, 1, 106401, "2015/12/17 15:00:00", "ジュエルがあれば\n貴重品と交換できるみたい\n大事に使いましょうね", 2, "シェフィ", 10, -363.0, 10004);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105801, "2015/12/17 15:00:00", "特定の条件を達成すると\n報酬がもらえますよ！\nがんばりましょう♪　", 1, "ペコリーヌ", 12, -416.5, 12001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 106001, "2015/12/17 15:00:00", "思い出が詰まってるって\nいろいろあったけど\n振り返るのもいいんじゃない？", 1, "キャル", 13, -363.0, 13001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105901, "2015/12/17 15:00:00", "主さまとの楽しい日々…\nこちらで何度でも\n思い返しましょう♪", 1, "コッコロ", 13, -363.0, 13002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 2104010, 1, 1, 106401, "2015/12/17 15:00:00", "みんなとの大切な思い出が\nたくさん詰まってるのね\n一緒に振り返って、\n心に刻みたいわ", 2, "シェフィ", 13, -363.0, 13003);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105801, "2015/12/17 15:00:00", "女の子との思い出が\nたくさん見られますよ！\nヒューヒュー♪\nモテモテですねー☆", 1, "ペコリーヌ", 13, -363.0, 13004);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105901, "2015/12/17 15:00:00", "育成に必要なアイテムが\n獲得できるクエストです\nわたくし、主さまのために、\n強くなりますよ", 1, "コッコロ", 14, -363.0, 14001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 2104010, 1, 1, 106401, "2015/12/17 15:00:00", "このクエストを攻略すると、\nアイテムが手に入るらしいわ。\nもっと強くなるために、\n一生懸命がんばるわね！", 2, "シェフィ", 14, -363.0, 14002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105801, "2015/12/17 15:00:00", "このクエストを攻略すれば、\nアイテムがもらえますよ\nたくさん集めて、どんどん\n強くなっちゃいましょう！", 1, "ペコリーヌ", 14, -363.0, 14003);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 106001, "2015/12/17 15:00:00", "クエストを攻略すると、\nアイテムが手に入るんだって\nもらえるものは、\nもらっておきましょ！", 1, "キャル", 14, -363.0, 14004);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105901, "2015/12/17 15:00:00", "主さま、旅の準備を整えて\nより充実した冒険をいたし\nましょう", 1, "コッコロ", 15, -470.0, 15001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 2104010, 1, 1, 106401, "2015/12/17 15:00:00", "ねぇ…クランに加入してみない？\n一人も楽しいけど、みんなと\n一緒も賑やかでいいと思うの", 2, "シェフィ", 16, -363.0, 16001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105801, "2015/12/17 15:00:00", "クランに加入してみませんか？\nみんなといっしょに冒険した方が、\n楽しいですよ！", 1, "ペコリーヌ", 16, -363.0, 16002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 106001, "2015/12/17 15:00:00", "クランに入れるらしいわよ\nせっかくだから入ってみたら？\nけっこう楽しいみたいよ♪", 1, "キャル", 16, -363.0, 16003);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105901, "2015/12/17 15:00:00", "こちらでクランに加入できます\n素敵なクランがたくさんあって、\n目移りしてしまいますね", 1, "コッコロ", 16, -363.0, 16004);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105901, "2015/12/17 15:00:00", " こちらではクランバトルに\n 参加された仲間のみなさんの\n 活躍を振り返ることができます", 1, "コッコロ", 17, -363.0, 17002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 106001, "2015/12/17 15:00:00", "模擬戦の戦績もアンタが\n気に入ったものがあれば\n記録しておけるのね", 1, "キャル", 25, -363.0, 17004);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105901, "2015/12/17 15:00:00", "主さま、今回のクランバトルでの\nご活躍が記録されています\nバトルの参考にいたしましょう", 1, "コッコロ", 25, -363.0, 17005);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 2104010, 1, 1, 106401, "2015/12/17 15:00:00", "今回のクランバトルの調子は\nどうかしら？\n戦績を見れば、次のバトルに\n活かせるかもしれないわ", 2, "シェフィ", 25, -363.0, 17006);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105801, "2015/12/17 15:00:00", "今回のクランバトルでの戦績を\nおさらいできますよ！\n私にも見せてください☆", 1, "ペコリーヌ", 25, -363.0, 17007);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 190801, "2015/12/17 15:00:00", "ようこそ！\nこちらでは、\nギルドハウスで流れる音楽の\n変更や購入が出来ますよ", 1, "カリン", 18, -363.0, 18001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 2, 190801, "2015/12/17 15:00:00", "ＢＧＭの変更や購入は、こちらから\nできますよ\n素敵な音楽を、たくさんご用意\nいたしました！", 1, "カリン", 18, -363.0, 18002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 3, 190801, "2015/12/17 15:00:00", "ギルドハウスの\nＢＧＭを変更できますよ\nあなたの好きな曲、\n私にも聴かせてくださいね", 1, "カリン", 19, -470.0, 19001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 4, 190801, "2015/12/17 15:00:00", "こちらでは、ＢＧＭの変更が\nできますよ\nどんな曲に変更しますか？\nふふふ、私も楽しみです♪", 1, "カリン", 19, -470.0, 19002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 5, 190801, "2015/12/17 15:00:00", "こちらでは、ＢＧＭを購入\nすることができますよ\n試聴することもできるので、\nじっくり選んでくださいね", 1, "カリン", 20, -470.0, 20001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 6, 190801, "2015/12/17 15:00:00", "いらっしゃいませ！\nＢＧＭの購入はこちらです\n素敵な曲がたくさんあって、\n目移りしちゃいますね", 1, "カリン", 20, -470.0, 20002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 106001, "2015/12/17 15:00:00", "ここで手に入れたアイテムで\n専用装備を作成できるみたいね\nアイテムが集まったら\nさっそく作ってみましょ！", 1, "キャル", 21, -363.0, 21001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105901, "2015/12/17 15:00:00", "攻略すると珍しいアイテムが\n手に入りますよ\nこのアイテムで専用装備を\n作成できるようです", 1, "コッコロ", 21, -363.0, 21002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 2104010, 1, 1, 106401, "2015/12/17 15:00:00", "専用装備が欲しいなら\nこのクエストに挑戦するといいわ\n集めた素材でもっともっと\n強くなりましょう", 2, "シェフィ", 21, -363.0, 21003);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 105801, "2015/12/17 15:00:00", "専用装備の作成に必要な\nアイテムを獲得できますよ\nたくさん集めてどんどん\n強くなりましょう！", 1, "ペコリーヌ", 21, -363.0, 21004);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 190801, "2015/12/17 15:00:00", "投票はこちらです\nあなたが応援したい女の子に\n思いを込めた一票を\nお願いします！", 1, "カリン", 22, -430.0, 22001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 2, 190801, "2015/12/17 15:00:00", "ようこそ！\nあなたが思いを寄せるのは\nどの女の子ですか？\n応援してあげてくださいね！", 1, "カリン", 22, -430.0, 22002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 3, 190801, "2015/12/17 15:00:00", "たくさんの投票、\nありがとうございました\n結果発表を楽しみに\n待っていてくださいね！", 1, "カリン", 23, -430.0, 23001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 4, 190801, "2015/12/17 15:00:00", "ただ今、人気投票の\n集計中です\n結果が出るまでもう少しだけ\nお待ちくださいね", 1, "カリン", 23, -430.0, 23002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (4.08, 10011, "2030/12/17 14:59:59", 8.0, 0, 2, 1, 109001, "2019/01/31 12:00:00", "あなた様が手伝ってくださった\nチョコレートケーキ\n美味しくないはずがありませんわ", 1, "エリコ（バレンタイン）", 24, -385.0, 24001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (5.0, 10011, "2030/12/17 14:59:59", 8.0, 0, 2, 2, 109001, "2019/01/31 12:00:00", "このような失敗、あなた様が\nするはずありません\nもう一度挑戦してみましょう", 1, "エリコ（バレンタイン）", 24, -385.0, 24002);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (10.11, 10011, "2030/12/17 14:59:59", 8.0, 0, 2, 3, 109001, "2019/01/31 12:00:00", "あなた様のために\n作っているケーキを\nあなた様に手伝っていただく……\nことになるなんて……クスクス", 1, "エリコ（バレンタイン）", 24, -385.0, 24003);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (4.0, 10011, "2030/12/17 14:59:59", 8.0, 0, 2, 4, 109001, "2019/01/31 12:00:00", "あまり気に病む必要はありませんわ\nこれからは私がたっぷりと\n時間をかけて教えて差し上げますから", 1, "エリコ（バレンタイン）", 24, -385.0, 24004);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (6.0, 10011, "2030/12/17 14:59:59", 8.0, 0, 2, 5, 109001, "2019/01/31 12:00:00", "今回は調子が悪かった……のですか？\nあなた様が手伝ってくれたものなら\nわたしはどんなものでも……クスクス", 1, "エリコ（バレンタイン）", 24, -385.0, 24005);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2030/12/17 14:59:59", 0.0, 0, 1, 6, 109002, "2019/01/31 12:00:00", "あなた様が手がけた\nチョコレートケーキは\n私にとっての宝物……\n侮辱する者は生かしておきませんわ", 1, "エリコ（バレンタイン）", 24, 0.0, 24006);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2030/12/17 14:59:59", 0.0, 0, 1, 7, 109002, "2019/01/31 12:00:00", "とても素晴らしい出来栄えですわ！\nあなた様にふさわしい\nチョコレートケーキができました", 1, "エリコ（バレンタイン）", 24, 0.0, 24007);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2030/12/17 14:59:59", 0.0, 0, 1, 8, 109002, "2019/01/31 12:00:00", "私を手伝ってくれたあなた様は\nすでに私の虜……\n甘い世界に誘って差し上げますわ", 1, "エリコ（バレンタイン）", 24, 0.0, 24008);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2030/12/17 14:59:59", 0.0, 0, 1, 9, 109002, "2019/01/31 12:00:00", "あなた様の愛情\nしかと受け止めました\nこれが……私たちの初めての\n共同作業ですわね……クスクス", 1, "エリコ（バレンタイン）", 24, 0.0, 24009);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2030/12/17 14:59:59", 0.0, 0, 1, 10, 109002, "2019/01/31 12:00:00", "これは世界一の\nチョコレートケーキですわ\nだって、あなた様が腕によりをかけて\n作ってくださったんですもの", 1, "エリコ（バレンタイン）", 24, 0.0, 24010);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2.12, 10011, "2030/12/17 14:59:59", 8.0, 0, 2, 1, 109101, "2019/01/31 12:00:00", "上手にできなくて残念だった？\nでも、弟くんの気持ちが嬉しいな\nいつだってお姉ちゃんは\nそばにいるからね♪", 1, "シズル（バレンタイン）", 24, -385.0, 24011);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (4.19, 10011, "2030/12/17 14:59:59", 8.0, 0, 2, 2, 109101, "2019/01/31 12:00:00", "うーん、弟くんには珍しく\n緊張しちゃったのかな？\nもう一度チャレンジしてみる？", 5, "シズル（バレンタイン）", 24, -385.0, 24012);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (2.3, 10011, "2030/12/17 14:59:59", 8.0, 0, 4, 3, 109101, "2019/01/31 12:00:00", "お姉ちゃんのお手伝い、\nよくできました！\nあー、\nまだつまみ食いしちゃダメだぞ！", 2, "シズル（バレンタイン）", 24, -385.0, 24013);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2030/12/17 14:59:59", 0.0, 0, 1, 4, 109102, "2019/01/31 12:00:00", "見てみて！\nスポンジに綺麗な焼き目がついてるよ\nさっすが弟くんだね！", 1, "シズル（バレンタイン）", 24, 0.0, 24014);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (5.23, 10011, "2030/12/17 14:59:59", 8.0, 0, 2, 5, 109101, "2019/01/31 12:00:00", "まぁまぁ、落ち込まないで\n見た目は……個性的だけど、\n味は絶対美味しいはずだから！", 5, "シズル（バレンタイン）", 24, -385.0, 24015);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2030/12/17 14:59:59", 0.0, 0, 1, 6, 109102, "2019/01/31 12:00:00", "弟くんみたいな\n可愛いケーキができたよ！\n早く食べてみたいでしょ♪", 1, "シズル（バレンタイン）", 24, 0.0, 24016);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (5.01, 10011, "2030/12/17 14:59:59", 8.0, 0, 2, 7, 109101, "2019/01/31 12:00:00", "あれれ？　弟くん、指に\nチョコレートがくっついてるよ？\nお姉ちゃんが舐めてあげるね、\nはぁむ！", 1, "シズル（バレンタイン）", 24, -385.0, 24017);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2030/12/17 14:59:59", 0.0, 0, 1, 8, 109102, "2019/01/31 12:00:00", "なかなか上手にできたんじゃない？\nでも弟くんはまだまだできる子！\nお姉ちゃん、信じてるからね", 1, "シズル（バレンタイン）", 24, 0.0, 24018);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2030/12/17 14:59:59", 0.0, 0, 1, 9, 109102, "2019/01/31 12:00:00", "わぁ～、\nとっても美味しそうにできたね！\n弟くん手慣れてたから\nお姉ちゃん安心して任せられちゃった！", 1, "シズル（バレンタイン）", 24, 0.0, 24019);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 10011, "2030/12/17 14:59:59", 0.0, 0, 1, 10, 109102, "2019/01/31 12:00:00", "や～ん、弟くんが手伝ってくれた\nチョコレートケーキ！\nすっごく美味しそうにできたね♪", 1, "シズル（バレンタイン）", 24, 0.0, 24020);
