INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 2, 123001, "2015/12/17 15:00:00", "ぼんやりしてる場合じゃないわ。\n早くミッションをクリアして\n報酬を受け取ってきなさい！", 1, "アメス", 44, -416.5, 43005);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (5.79, 0, "2030/12/17 14:59:59", 0.0, 0, 2, 3, 123001, "2015/12/17 15:00:00", "ちょっとあんた、報酬が\n受け取れるじゃない！\n忘れずにチェックなさい。\nアメス様との約束よ？", 1, "アメス", 45, -416.5, 43006);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 1, 1, 123001, "2015/12/17 15:00:00", "はい、お疲れさま。\nここではマスタリーチケットを\n使って、マスタリー強化素材を\n手に入れることができるわよ。", 1, "アメス", 46, -371.5, 46001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (0.0, 0, "2030/12/17 14:59:59", 0.0, 0, 2, 1, 104901, "2015/12/17 15:00:00", "呼ばれて飛び出てお姉ちゃんだよ♪\nたとえ火の中、水の中、迷宮の中っ\nこのダンジョンを踏破できるよう\n弟くんを応援してあげるからねっ♪", 2, "シズル", 47, -416.5, 47001);
INSERT INTO `v1_4e9157c295b55a00b59b177e46d31c8c634da87dd99d800078945262bda3dc07` VALUES (9.32, 0, "2030/12/17 14:59:59", 0.0, 0, 2, 1, 101101, "2015/12/17 15:00:00", "ほんとーに不思議な場所ですね～\nお兄ちゃんが冒険を頑張れるよう\nおまじないをかけてあげますねっ\nフレーフレー、お・兄・ちゃんっ♪", 1, "リノ", 47, -416.5, 47002);
